import React, {Component} from 'react';
import {Link, NavLink} from 'react-router-dom'
import Logo from '../shopclone.png'
import Signin from '../signin.png'
import M from 'materialize-css'
import './navbarstyle.css'

class navbar extends Component {

    componentDidMount() {
        document.addEventListener('DOMContentLoaded', function() {
            var elems = document.querySelectorAll('.sidenav');
            var instances = M.Sidenav.init(elems, {});
          });
        
          document.addEventListener('DOMContentLoaded', function() {
            var elems = document.querySelectorAll('.dropdown-trigger');
            var instances = M.Dropdown.init(elems, {});
          });
    }

    render() {
        return (
            <nav>
                <div class="nav-wrapper green darken-3">
                    <a href="/"><img className="Mainlogo" src={Logo}/></a>
                    <a href="#" data-target="mobile-demo" class="sidenav-trigger">
                        <i class="material-icons">menu</i>
                    </a>
                    <ul class="right hide-on-med-and-down">
                        <li><a href="/">Home</a></li>
                        <li><a href="/drinks">Drinks</a></li>
                        <li><a href="/chocolate">Chocolate</a></li>
                        <li><a href="/accessories">Accessories</a></li>
                        <li><a href=""></a></li>
                        <li><a href=""></a></li>
                    </ul>
                        <a class='signindrop dropdown-trigger right' href='/account' data-target='dropdown1'>
                            <img className="Signin brand-logo right" src={Signin}/>
                        </a>
                </div>

            <ul class="sidenav" id="mobile-demo">
                <li><a href="/">Home</a></li>
                <li><a href="/drinks">Drinks</a></li>
                <li><a href="/chocolate">Chocolate</a></li>
                <li><a href="/accessories">Accessories</a></li>
            </ul>

            <ul id='dropdown1' class='dropdown-content'>
                <li><a href="#!">one</a></li>
                <li><a href="#!">two</a></li>
                <li class="divider" tabindex="-1"></li>
                <li><a href="#!">three</a></li>
                <li><a href="#!"><i class="material-icons">view_module</i>four</a></li>
                <li><a href="#!"><i class="material-icons">cloud</i>five</a></li>
            </ul>

        </nav>
    
        )
    }
}



export default navbar
